  true,\n\t\"url\": null,\n\t\"notes\": \"Technical Reference for Hydrogen Compatibility
  of Materialsrn---------------------------------------------------------------------rnrnGuidance
  on materials selection for hydrogen service is needed to support the deployment
  of hydrogen as a fuel as well as the development of codes and standards for stationary
  hydrogen use, hydrogen vehicles, refueling stations, and hydrogen transportation.
  Materials property measurement is needed on deformation, fracture and fatigue of
  metals in environments relevant to this hydrogen economy infrastructure. The identification
  of hydrogen-affected material properties such as strength, fracture resistance and
  fatigue resistance are high priorities to ensure the safe design of load-bearing
  structures.rnrnTo support the needs of the hydrogen community, Sandia National Laboratories
  (\"Sandia\") is conducting an extensive review of reports and journal publications
  to gather existing materials data for inclusion in the *Technical Reference for
  Hydrogen Compatibility of Materials*. Additionally, Sandia is working internationally
  with collaborators to acquire newly generated data for inclusion in the Technical
  Reference. **SAND2012-7321** is an archival report issued by Sandia National Laboratories
  representing the reference information compiled as of September 2012. Updates and
  additions of individual sections of this report are available at http://www.sandia.gov/matlsTechRef
  .rnrn### Technical Database for Hydrogen Compatibility of MaterialsrnThe Technical
  Database for Hydrogen Compatibility of Materials is intended to be a complement
  to the Technical Reference for Hydrogen Compatibility of Materials. Although still
  in the development stage, the Technical Database will provide a repository of technical
  data measured in hydrogen and is meant to be an engineering tool to aid the selection
  of materials for use in hydrogen.rnrnThe structure of the Technical Database will
  mirror the Technical Reference, using the same designations and classifications
  of materials. Below are some examples of the database information that is being
  compiled in the form of spreadsheets. A single material from a single study is represented
  in each spreadsheet: the material is indicated by the first four digits; the author
  and year are represented by the following characters; and the type of data follows
  (i.e. tensile, fracture and/or fatigue).rnrn#### Plain Carbon Ferritic Steelsrnrn-
  1100_CIA85_ten_fra_fat.xlsxrn- 1100_SAN10_fra_fat.xlsxrn- 1100_SAN10B_fra_fat.xlsxrn-
  1100_SAN11_fra_fat.xlsxrn- 1100_SAN11B_fra_fat.xlsxrnrn#### Low-Alloy Ferritic Steelsrnrn-
  1211_NIB10_fra_fat.xlsxrn- 1211_SAN11_fat.xlsx rnrn#### Aluminum Alloysrnrn- 3230_SAN11_far_fat.xlsxrnrn*Financial
  support for the Technical Reference and the Technical Database is provided by the
  Safety, Codes and Standards program element of the Hydrogen and Fuel Cells Program,
  Office of Energy Efficiency and Renewable Energy, United States Department of Energy.*rn\",\n\t\"license_title\":
